// HasAssignment applies the HasEdge predicate on the "assignment" edge.
func HasAssignment() predicate.AssignmentDetails {
	return predicate.AssignmentDetails(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, AssignmentTable, AssignmentColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasAssignmentWith applies the HasEdge predicate on the "assignment" edge with a given conditions (other predicates).
func HasAssignmentWith(preds ...predicate.PositionAssignment) predicate.AssignmentDetails {
	return predicate.AssignmentDetails(func(s *sql.Selector) {
		step := newAssignmentStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.AssignmentDetails) predicate.AssignmentDetails {
	return predicate.AssignmentDetails(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.AssignmentDetails) predicate.AssignmentDetails {
	return predicate.AssignmentDetails(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.AssignmentDetails) predicate.AssignmentDetails {
	return predicate.AssignmentDetails(sql.NotPredicates(p))
}
